import React, { Component } from 'react';
// import './App.css';
import { Table } from 'react-bootstrap';

const illnesses = ["Common cold",
  "Nausea",
  "Mental Health",
  "Migraines",
  "Digestive Disorders",
  "Eye health",
  "Food Poisoning",
  "Kidney Stones",
  "Dermotology",
  "Menstrual health",
  "Osteoporasis",
  "Sleep Disorders"];
const list = illnesses.map((illness) =>
  <tr>
    <td>"#"</td>
    <td>{illness}</td>
  </tr>
);

class List extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1>List of Illnesses</h1>
          <Table bordered condensed hover>
            <thead><tr><th></th></tr></thead>
            <tbody>
              <tr><td>Hi</td></tr>
              <tr><td>Hi</td></tr>
              <tr><td>Hi</td></tr>
            </tbody>
          </Table>
        </header>
      </div>
    );
  }
}

export default List;
